import React, { useState, useEffect } from "react";
import { useSelector } from "react-redux";
function Employee() {
  const employees = useSelector((state) => state.employees);
  console.log(employees, "5555555555555");
  {
    employees.map((e) => (
      <div key={e.id}>
        <div>{e.Name}</div>
      </div>
    ));
  }
}

export default Employee;
